row.EN-Gloss:
quantifier; used with either mass nouns or plural count nouns for indicating a complete or almost complete lack or zero quantity of;
    "we have no bananas"; "no eggs left and no money to buy any"; "have you no decency?"; "did it with no help"; "I'll get you there in no
    time"

(comparative of `good') superior to another (of the same class or set or kind) in excellence or quality or desirability or suitability;
    more highly skilled than another; "You're a better man than I am, Gunga Din"; "a better coat"; "a better type of car"; "a suit with a better
    fit"; "a better chance of success"; "produced a better mousetrap"; "she's better in math than in history"
